import React, {useState} from 'react';

import { 
    IonGrid,
    IonRow,
    IonCol,
    IonButton,
    IonIcon,
    IonInput,
    IonLabel,
    IonSearchbar
} from '@ionic/react';

import { close } from "ionicons/icons";

import '../assets/css/Custom.css';
import '../assets/css/Responsive.css';

const StartConversationPopup: React.FC = () => {

    const [searchText, setSearchText] = useState('');

    return (

        <IonGrid className="start-conversation-popup-wrapper">

            <div className="popup-title">
                <h4>Receipt</h4>
            </div> 

            <div className="popup-content">

                <div className="search-box">
                    <IonSearchbar value={searchText} onIonChange={(e) => setSearchText(e.detail.value!)} animated></IonSearchbar>
                </div>
                <IonRow  className="popup-buttons">
                    <IonCol size="6">

                    </IonCol>
                    <IonCol size="6">
                        
                    </IonCol>
                </IonRow>
            </div>

        </IonGrid> 
        // </IonPopover>
        
    );
};

export default StartConversationPopup;
